import Layout from '../components/layout/Layout';
import Card from '../components/courses/Card';

const Home = (props) => {
  return (
    <Layout>
      <Heading>HOME</Heading>

      <Grid h='100%' templateColumns='repeat(5, 1fr)' gap={10}>
        <Card></Card>
      </Grid>
    </Layout>
  );
};

export default Home;
